/* -------  header container - menu closed  ------- */
.headerContainer {
  background:#f5f5f5;
  color:#070707;
  width:100%;
  font-size:1.2em;
  z-index:10;
}

/* -------  logo container  ------- */
.logoContainer {
  height:60px;
  padding:0 2%;
  display:flex;
  justify-content:space-between;
  align-items:center;
}
/* -------  logo  ------- */
.logo {
  display:block;
  height:48px;
  padding:1%;
}

/* -------  trigger  ------- */
.trigger {
  width:52px;
  height:52px;
  position:relative;
  cursor:pointer;
}
/* -------  trigger line  ------- */
.triggerLine {
  height:2px;
  width:24px;
  display:block;
  background:#070707;
  position:absolute;
  top:25px;
  left:14px;
  transition:transform 0.22s;
}
/* -------  trigger line - top  ------- */
.triggerTop {
  transform:translateY(-4px);
  composes:triggerLine;
}
/* -------  trigger line - bottom  ------- */
.triggerBottom {
  transform:translateY(4px);
