/* -------  loading container  ------- */
.loadingContainer {
  display:flex;
  justify-content:center;
}

/* -------  svg container  ------- */
.svgContainer {
  position:relative;
  width:20%;
  max-width:140px;
  height:50%;
 }

 /* -------  svg container - ::after  ------- */
.svgContainer::before {
  content:'';
  display:block;
  padding-top:100%;
}

/* -------  svg  ------- */
.svg {
  width:100%;
  height:100%;
  position:absolute;
  top:0;
  bottom:0;
  left:0;
  right:0;
  margin:auto;
  transform-origin:center center;
  animation:rotate 2s linear infinite;
 }

 /* -------  svg - path  ------- */
.svgPath {
  stroke:#f5f5f5;
  stroke-dasharray:1,200;
  stroke-dashoffset:0;
  stroke-linecap:round;
  animation:dash 1.5s ease-in-out infinite;
}

/* -------  keyframes - rotate  ------- */
@keyframes rotate {
  100% {
    transform:rotate(360deg);
  }
}

/* -------  keyframe - dash  ------- */
@keyframes dash {
  0% {
    stroke-dasharray:1,200;
    stroke-dashoffset:0;
  }
  50% {
    stroke-dasharray:89,200;
    stroke-dashoffset:-35px;
  }
  100% {
    stroke-dasharray:89,200;
    stroke-dashoffset:-124px;
  }
}
